  14,\n\t\"tags\": [],\n\t\"title\": \"Line W Hydrography including pressure, temperature,
  salinity, dissolved oxygen, sulfur hexafluoride, and dissolved chlorofluorocarbons
  from bottle and CTD casts from the R/V OCEANUS in the Northwest Atlantic from August
  31st, 2009 to September 7th, 2009 (NODC Accession 0068682)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-09-27T03:04:15.235034\",\n\t\"name\": \"line-w-hydrography-including-pressure-temperature-salinity-dissolved-oxygen-sulfur-hexafluoride\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represent one of a series
  of hydrographic sections conducted along Line W from the continental shelf south
  of New England toward Bermuda. A total of 26 full depth casts consisting of CTD
  (conductivity, temperature, pressure and oxygen), LADCP (lowered acoustic Doppler
  current profiler),and rosette water samples were collected between 31AUG2009 and
  10SEP2009. Salinity and dissolved oxygen were analyzed from water samples on board
  the ship and used to calibrate the CTD sensors. Water samples were also analyzed
  for transient tracers (CFCs, SF6 and I-129).\",\n\t\"license_title\": null,\n\t\"extras\":
